 - kodu agencji wydającej zgodnie z ISO/IEC 15459;
 - numeru licencji lub kontraktu zgodnego ze specyfikacjami danej agencji wydającej;
 i który:
 - składa się wyłącznie z wielkich liter alfabetu i/lub cyfr;
 - jest unikalny (to znaczy, różni się od jakiegokolwiek innego identyfikatora zgodnego z ISO/IEC 15459) w domenie agencji wydającej;
 - nie może być pochodną żadnego innego identyfikatora zgodnego z ISO/IEC 15459, wydanego na mocy tej samej agencji wydającej, poprzez prost

