Kod lokalizacji '26L', będący kodem identyfikującym lokalizację lub obszar geograficzny, lub powiązaną grupę takich lokalizacji lub obszarów, mający znaczenie dla powiązanej transakcji i zgodny z jedną ze struktur zdefiniowanych w (a) do (f) poniżej:
a) dwie wielkie litery alfabetu odpowiadające dwuliterowemu kodowi kraju ISO 3166-1 kraju, w którym znajdują się lokalizacje lub obszary lub składają się z nich;
b) trzy wielkie litery alfabetu odpowiadające kodowi IATA lotniska lub miasta, w którym znajdują się lokalizacje lub obszary lub składają się z nich;
c) cztery lub więcej znaków, z których pierwsze trzy odpowiadają kodowi kraju ISO 3166-1, po których następuje myślnik (-), z resztą będącą kodem pocztowym w danym kraju;
d) cztery lub więcej znaków, z których pierwsze trzy odpowiadają kodowi kraju ISO 3166-1, po których następuje kropka (.), z resztą będącą kodem podziału kraju ISO 3166-2 w danym kraju;
e) pięć wielkich liter alfabetu odpowiadających kodowi UN/LOCODE obszaru, w którym znajdują się lokalizacje lub obszary lub składają się z nich;
f) połączenie, mające nie mniej niż siedem i nie więcej niż 35 znaków długości, składające się z:
- kodu agencji wydającej zgodnie z ISO/IEC 15459;
- kodu lokalizacji, składającego się ze znaków z zestawu {A-Z; 0-9} zgodnego ze specyfikacjami danej agencji wydającej.

