Identyfikator sprzętu, będący globalnie unikatowym identyfikatorem urządzenia, przedmiotu wyposażenia lub instancji aplikacji komputerowej używanej w produkcji, transporcie, przetwarzaniu lub innym obsługiwaniu przedmiotów, który jest konstruowany przez połączenie:
 - kodu agencji wydającej zgodnie z ISO/IEC 15459;
 - numeru sprzętu zgodnego ze specyfikacjami danej agencji wydającej; i który:
 - składa się wyłącznie z wielkich liter alfabetu i/lub cyfr;
 - jest unikalny (to znaczy, różni się od jakiegokolwiek innego identyfikatora zgodnego z ISO/IEC 15459) w domenie agencji wydającej;
 - nie może pochodzić od żadnego innego identyfikatora zgodnego z ISO/IEC 15459, wydanego na mocy tej samej agencji wydającej, poprzez prost

Kod lokalizacji UPU, będący kodem identyfikującym lokalizację lub obszar geograficzny, lub związaną grupę takich lokalizacji lub obszarów, mający znaczenie dla powiązanej transakcji i zgodny z jedną ze struktur zdefiniowanych w punktach a) do g) poniżej:
a) dwa wielkie litery odpowiadające kodowi kraju ISO 3166-1 alpha-2 kraju, w którym lub z którego składają się lokalizacje lub obszary;
b) trzy wielkie litery odpowiadające kodowi IATA lotniska lub miasta, w którym, blisko którego lub z którego składają się lokalizacje lub obszary;
c) cztery lub więcej znaków, z których pierwsze trzy odpowiadają kodowi kraju ISO 3166-1, po których następuje myślnik (-), a reszta to kod pocztowy w danym kraju;
d) cztery lub więcej znaków, z których pierwsze trzy odpowiadają kodowi kraju ISO 3166-1, po których następuje kropka (.), a reszta to kod podziału kraju ISO 3166-2 w danym kraju;
e) pięć wielkich liter odpowiadających kodowi UN/LOCODE obszaru, w którym, blisko którego lub z którego składają się lokalizacje lub obszary;
f) sześć wielkich znaków alfanumerycznych odpowiadających kodowi IMPC UPU przypisanemu zgodnie ze standardem UPU S34;
g) konkatenacja, mająca nie mniej niż siedem ani więcej niż 25 znaków długości, z:
 - kodem wydawcy przypisanym zgodnie ze standardami UPU S31;
 - kodem lokalizacji, składającym się ze znaków z zestawu {A-Z; 0-9}, który odpowiada specyfikacjom wydawcy.

Tablica rejestracyjna z danymi usługi i kodem lokalizacji jest złożoną konstrukcją danych, zgodną ze specyfikacją standardu UPU S25, która obejmuje specyfikację:
 - identyfikatora przedmiotu zgodnego z ISO/IEC 15459;
 - specyfikację usługi do świadczenia w odniesieniu do przedmiotu zgodną z identyfikatorem danych 5U;
 - identyfikator lokalizacji UPU zgodny z identyfikatorem danych 17U lub kwalifikowany kod lokalizacji UPU zgodny z identyfikatorem danych 18U.
 Uwaga - Aby uzyskać więcej informacji, proszę zapoznać się ze standardem UPU S25. Różnica między prostym kodem lokalizacji UPU (DI 17U) a kwalifikowanym kodem lokalizacji UPU (DI 18U) można określić na podstawie pierwszego znaku. Jeśli jest to cyfra, stosuje się 18U; jeśli jest to litera, stosuje się 17U.

