Data, reprezentowana w zmodyfikowanej formie zgodnej z UTC:
yyyy[mm[dd[hh[mm[ss[fff]]]]]][poooo], gdzie nawiasy kwadratowe oznaczają opcjonalność, yyyy to rok, mmdd to miesiąc i dzień, hhmmss to godzina dnia w godzinach, minutach i sekundach, fff to ułamki sekund, a poooo to przesunięcie względem UTC wyrażone w godzinach i minutach, przesunięcie będące dodatnie, jeśli p to kropka (.), ujemne, jeśli P to znak minus (-).
PRZYKŁAD:
2005 - (UTC) rok kalendarzowy 2005;
200505 - (UTC) miesiąc kalendarzowy maj 2005;
20050518 - (UTC) 18 maja 2005;
200505181247 - 12:47 UTC 18 maja 2005;
200505181247.0100 - 12:47 czasu lokalnego, czyli 11:47 UTC, 18 maja 2005;
20050518124723099 - 99 milisekund po 12:47:23 UTC 18 maja 2005.

Kwalifikowana data, składająca się z konkatenacji:
- kodu wydającego ISO/IEC 15459;
- kwalifikatora daty zgodnego ze specyfikacjami tego wydającego;
- daty, której format i interpretacja są zgodne ze specyfikacjami wydającego dla tego kwalifikatora daty.

Deklaracja kategorii materiału opakowaniowego*, kodu* i wagi dla danego materiału opakowaniowego używanego w danym opakowaniu zgodnie z dyrektywą UE dotyczącą opakowań i odpadów opakowaniowych. (Kategoria materiału i kod zdefiniowane w załączniku M).
12ECCMMMMMMNNNNNUU gdzie: - '12E' (an3) to identyfikator danych;
 - 'CC' (n2) to Kategoria Materiału według Załącznika M;
 - 'MMMMMM' (an1...6) to Kod Materiału według Załącznika M;
 - 'NNNNN' (n5) Waga Materiału, w tym przecinek dziesiętny (np. 12,12);
 - 'UU' (an2) to Jednostka miary wagi (np. KG, GR, LB lub OZ według ANSI X12.3, jak w Załączniku D).

