Numer odbiorcy.
Unikalny numer identyfikacyjny może być IRS, EIN, SSN lub numerem przypisanym przez CBP, jak wymagane w zgłoszeniu bezpieczeństwa. Tylko następujące formaty powinny być używane: IRS EIN: NN-NNNNNNN;
IRS EIN z sufiksem:
NN-NNNNNNNXX;
SSN: NNN-NN-NNNN;
CBP przypisany nbr: YYDDPP-NNNNN.
